let posts;

let logLines = [];
let logLength = 10;
function log(message) {
  logLines.push(`${new Date().toString()}: ${message}`);
  if (logLines.length > 10) {
    logLines = logLines.slice(logLines.length - logLength);
  }
  let log = document.getElementById("log");
  log.innerText = logLines.join("\n");
}

let postsTestData = [
  {
    post_timestamp: {
      year: 2023,
      month: 10,
      day: 19,
      hour: 14,
      minute: 53,
      second: 0,
    },
    author: `bobbydigitales`,
    text: "This is my first post on a new platform that I hope will change some things!",
  },
  {
    post_timestamp: {
      year: 2023,
      month: 10,
      day: 19,
      hour: 14,
      minute: 53,
      second: 0,
    },
    author: `bobbydigitales`,
    text: "Second post!",
    image: ``,
  },
];

for (let i = 0; i < 1000; i++) {
  postsTestData.push({
    author: "bobbydigitales",
    text: new Date().toString() + i,
    image: null,
  });
}

function post(posts, author, text, image) {
  posts.push({ author: author, text: text, image: image });
  localStorage.setItem("dandelion_posts", JSON.stringify(posts));
}

async function registerServiceWorker() {
  if (!("serviceWorker" in navigator)) {
    return;
  }

  let registrations = await navigator.serviceWorker.getRegistrations();
  if (registrations.length > 0) {
    console.log("Service worker already registered.");
    return registrations[0];
  }

  navigator.serviceWorker
    .register("/sw.js")
    .then((registration) => {
      console.log("Service Worker registered with scope:", registration.scope);
      return registration;
    })
    .catch((error) => {
      console.error("Service Worker registration failed:", error);
    });
}

function addPost(postText) {
    let post =   {
        author: `bobbydigitales`,
        text: postText,
      }

    posts.unshift(post);
    localStorage.setItem("dandelion_posts", JSON.stringify(posts));

}

async function main() {
  let time = 0;
  let delta = 0;

  let registration = await registerServiceWorker();

  let main = await fetch("/main.js");
  let code = await main.text();
  //   console.log(code);
  //   registration.active.postMessage({type:"updateMain", code:code});

  let postButton = document.getElementById("button_post");
  let postText = document.getElementById("textarea_post");
  if (!(postButton && postText)) {
    throw new Error();
  }

  postButton.addEventListener("click", ()=>{addPost(postText.value)});

  time = performance.now();
  let postsJSON = localStorage.getItem("dandelion_posts");
  delta = performance.now() - time;
  delta = delta.toFixed(2);
  if (postsJSON) {
    log(`read ${postsJSON.length} bytes from localStorage in ${delta}ms`);
  }

  posts = {};
  try {
    time = performance.now();
    posts = JSON.parse(postsJSON);
    delta = performance.now() - time;
    delta = delta.toFixed(2);
    log(`parsed ${posts.length} posts from localStorage in ${delta}ms`);
  } catch (e) {
    log("Couldn't read posts from local storage, resetting...");
  }

  if (!posts) {
    localStorage.setItem("dandelion_posts", JSON.stringify(postsTestData));
    posts = postsTestData;
  }

  for (const postData of posts) {
    let post = renderPost(postData);
    let contentDiv = document.getElementById("content");

    if (!contentDiv) {
      throw new Error("Couldn't get content div!");
    }

    contentDiv.appendChild(post);
  }
}

function renderPost(post) {
  if (!("text" in post)) {
    throw new Error("Post is malformed!");
  }
  let containerDiv = document.createElement("div");
  let textDiv = document.createElement("div");
  textDiv.innerText = post.text;
  containerDiv.appendChild(textDiv);

  if (!("image" in post && post.image)) {
    return containerDiv;
  }

  let image = document.createElement("img");
  image.src = image.src = "data:image/png;base64," + post.image;

  containerDiv.appendChild(image);
  return containerDiv;
}

window.addEventListener("load", main);
